import assert from "node:assert";
import { describe, it } from "vitest";
import { getID3Tags } from "./id3.ts";
import { readFileSync } from "node:fs";

describe("getID3Tags", () => {
  it("mp3", async () => {
    const tags = {
      artist: "SoMe Band4",
      album: "Test",
      title: "test",
      trackNumber: 5,
      image:
        "data:image/jpeg;base64, ",
    };
    const file = readFileSync("test_data/test.mp3");

    assert.deepEqual(await getID3Tags(file), tags);
  });
});
